import React from 'react';
import {Card} from 'react-bootstrap';
import { connect } from 'react-redux';
import Task from '../Task/Task';


class DeletedList extends React.PureComponent
{
   render()
   {
    

       return(
        <Card className="DoingList_card">
        <Card.Body>
            <Card.Text> Deleted </Card.Text>
            {
          // this.props.deletedTasks.map(t => (<Task key={t.id} {...t} ></Task>))
          this.props.doingTasks.filter(t => t.deleted).map(t => (<Task key={t.id} {...t} ></Task>))

          }
        </Card.Body>
        </Card>
       )
   }
}
// export default DeletedList;
const mapStateToProps = state => ({
    // deletedTasks: state.doingTasks.filter(t => t.deleted ),
    doingTasks: state.doingTasks,
  });
  
  
  
  
  
  export default connect(mapStateToProps)(DeletedList);
